 CREATE TABLE RESUMEN_APORTE_SBIF
 (mes_anno VARCHAR2(6) NOT NULL,
  tipo_transaccion VARCHAR2(40) NOT NULL,
  monto_total_transacciones NUMBER(10) NOT NULL,
  aporte_total_abif NUMBER(10) NOT NULL,
  CONSTRAINT PK_RES_APORTE_SBIF PRIMARY KEY(mes_anno,tipo_transaccion));  

CREATE TABLE BALANCE_ANUAL_DETALLE_TRANSAC
(mes_anno VARCHAR2(8) NOT NULL,
 run_cliente VARCHAR2(15) NOT NULL,
 nro_tarjeta NUMBER(30) NOT NULL,
 fecha_transaccion DATE NOT NULL,
 nro_transaccion NUMBER(10) NOT NULL,
