 valor_cuota NUMBER(8),
 fecha_pago DATE,
 monto_pagado NUMBER(8),
 deuda_pago_cuota NUMBER(8),
 deuda_por_pagar NUMBER(8),
 CONSTRAINT PK_BANUAL_DET_TRANSAC PRIMARY KEY(nro_tarjeta,fecha_transaccion,nro_transaccion,fecha_venc_cuota));


 
 











UPDATE CUOTA_TRANSAC_TARJETA_CLIENTE
SET monto_pagado=valor_cuota,
    fecha_pago=fecha_venc_cuota-2
WHERE EXTRACT(YEAR FROM fecha_venc_cuota) < EXTRACT(YEAR FROM SYSDATE);

